import React from "react";
import ReactDOM from "react-dom";
import {useState} from "react";
import Allnotes from "../Allnotes";
function newNote() {

  var content1="ansh";
var [title1,setTitle]=useState("");
function handleChange(event)
{
  setTitle(event.target.value);
}
function clicked()
{
  console.log(title1);
  console.log(content1);
}
  return (
    <div className="note">
    <form >
    <textarea id="inputTitle" placeHolder="Click to add Title" onChange={handleChange} value={title1} />
    <textarea type="text" id="inputContent" placeHolder="Click to add Content" value={content1} />
    </form>
    <button type="button" class="btn" onClick={clicked}>Make Note</ button>
    </div>
  );
}
export default newNote;
